import * as ActionsTypes from './ActionsTypes'

export const setLoading = (payload) => ({
    type: ActionTypes.DISH_LOADING,
    payload
})

export const setError = (payload) => ({
    type: ActionTypes.LOAD_DISH_FAIL,
    payload
})

export const setSuccess = () => ({
    type: ActionTypes.LOAD_DISH_SUCESS
})

export const loadTrash = (payload) => ({
    type: ActionTypes.LOAD_DISH,
    payload
})
export const getDish = () => {
    return dispatch => {
        dispatch(setLoading(true));
        fetch()
            .then(res => {
                dispatch(setLoading(false));
                if (res.data) {
                    dispatch(setSuccess());
                    dispatch(loadTrash(res.data.data));

                }
            })
            .catch(e => {
                message.error('Something went wrong');
                dispatch(setLoading(false));
                dispatch(setError(e));
            });
    }
}
